  \"squaw-creek-national-wildlife-refuge-comprehensive-conservation-plan-and-environmental-ass\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This Comprehensive Conservation Plan (CCP)
  was written to guide management on Squaw Creek NWR for the next 15 years. This plan
  outlines the Refuge vision and purpose and describes how Squaw Creek NWR will contribute
  to the overall mission of the Refuge System. The plan provides an introduction to
  the Refuge, an overview of the CCP process, information about the Refuge environment
  and management, a summary of the management direction, and strategies for implementation.
  Key planning issues include: wildlife habitat and resource management, land management,
  snow goose management, Refuge expansion, public use, and public service.\",\n\t\"license_title\":
